import React, {Component} from 'react';
import './Birds.css'


class Birds extends Component {


    clickResult(item) {
        this.props.answerData(item)
    }
    clazz(){
        const {data,data2} = this.props;
        for(let i = 0; i<=data;i++){
            if(data[i].id === data2){
                return 'success'
            }

        }
    }

    render() {
        const {data} = this.props;
        return (
            <ul className="item-list list-group">
                {data.map((item) => (
                    <li className={`list-group-item ${this.clazz}`} key={item.id} onClick={() => this.clickResult(item)}>
                      <span className={'li-btn'}>
                      </span>
                        {item.name}
                    </li>
                ))}
            </ul>
        );
    }
}

export default Birds;
